import MainNavigation from "../components/MainNavigation";

function Error() {
  return (
    <>
      <MainNavigation />
      <main>
        <n1>An error occurred!</n1>
        <p>Could not find this Page</p>
      </main>
    </>
  );
}
export default Error;
